import React from 'react';
import styled from "styled-components";

function Login() {
  return (
    <Container>
    <Nav_logo
        src="/images/mouse-clicker.png"
        alt="netflix_logo"
    />
    </Container>
  )
}

const Container=styled.main`
    height: 100%;
    position:relative;
    overflow:hidden;
    background: url("/images/valoImg.jpg") center no-repeat;
        background-size: cover;
        content:"";
        position: absolute;
        top:0;
        left:0;
        right:0;
        bottom:0;
        z-index:-1;
`

const Nav_logo=styled.img`
    position: fixed;
    left: 20px;
    width: 60px;
    object-fit: contain;
`

export default Login
